import { BrowserRouter, Route } from "react-router-dom";
import { HomePage } from "./HomePage/HomePage";
import { Login } from "./Login/Login";

const App = () => {
  return (
    <BrowserRouter>
    <switch>

    <Route exact path="/HomePage/HomePage">
      <HomePage />
    </Route>
    <Route exact path="/Login/Login">
      <Login />
    </Route>
    </switch>
    </BrowserRouter>
  );
};

export { App };
